import { Container, Row, Col, Button } from "react-bootstrap";
import NavbarUser from "../components/navbar/NavbarUser";
import React from "react";
import { Link } from "react-router-dom";
import DummyBook from "../assets/dummy-book/cover-cust-699.jpeg";

function Cart() {
  return (
    <>
      <NavbarUser />
      <Container>
        <div className="mt-5 f-1 mb-5">
          <h2>My Cart</h2>
        </div>
      </Container>

      <Container className="bg-light d-flex px-5">
        <div className="col">

            <div className="d-flex row-1">
              <div className="w-25">
                <img
                  src={DummyBook}
                  alt="book"
                  className="w-100"
                />
              </div>

              <div className="f-2 w-100 bg-secondary no-border p-3 w-75">
                <h5 className="card-title f-1">The Mysterious Island</h5>
                <p className="card-text fs-8">By. Anonymous</p>
                <p className="card-text fw-bold price-color fs-7">Rp.150.000</p>
              </div>

          </div>



        </div>

        <div className="col bg-dark text-white">
            <h1>Tes</h1>
        </div>
      </Container>
    </>
  );
}

export default Cart;
